import logo from './logo.svg';
import './App.css';
import MyButton from './login/login';

function App() {
  return (
      <>
      <nav>
        <tr>home</tr>
        <li>about</li>
        <oi>carrer</oi>
      </nav>

    <div className="App">

      <h1>this is my first page</h1>
      <button>I'm a button</button>

    </div>
    </>
  );
}

// export default App;
export default function MyApp() {
  return (
    <div>
      <h1>Welcome to my app</h1>
      <App />
      <MyButton />
    </div>
  );
}
